DROP VIEW IF EXISTS `view_count_santri`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `view_count_santri` AS SELECT
	YEAR (
		`data_siswa`.`created_at`
	) AS `tahun`,
	count(0) AS `jumlah`
FROM
	`data_siswa`
GROUP BY
	YEAR (
		`data_siswa`.`created_at`
	) ;
